INSERT INTO `sys_institucion` (`id`, `institucion`, `abreviatura`, `tipo_univ`, `mision`, `vision`, `descripcion`, `portal`, `rif`, `telefono`, `direccion`, `latitud`, `longitud`, `slogan`, `resolucion`, `estado_id`, `municipio_id`, `correo`, `logo`, `marcador`, `escudo`, `portada`, `status`, `config_nota`, `config_recup`, `formula_indice`, `created_by`, `created_at`, `updated_by`, `updated_at`) VALUES
(1, 'Universidad Bolivariana De Los Trabajadores Jesús Rivero', 'UBTJR', 'Publica', 'Lograr a través de la autoformación colectiva, integral, continua y permanente, el desarrollo de la conciencia social de la clase trabajadora, su potencial creativo y los principios éticos del trabajo libre para que, desarrollando y aplicando el conocimie', 'La Universidad Bolivariana de Trabajadores Jesús Rivero tiene como visión vincular la autoformación, colectiva, integral, continua y permanente, con los más altos intereses de la soberanía nacional, las necesidades sociales y el ambiente, fusionando en un', 'En el marco de la Misión Alma Mater, se formaliza la creación el 13 de febrero de 2009 de la UNES, en el año 2009; como la institución universitaria especializada en la profesionalización y el desarrollo integral de funcionarias y funcionarios de seg', 'https://www.ubtjr.edu.ve/portal/', NULL, NULL, '', 10.5019516041, -66.9168100573, NULL, NULL, 24, 462, NULL, 0x2e2f696d672f5542544a522d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f5542544a522d6d61726361646f722e706e67, NULL, 0x2e2f696d672f5542544a522d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(2, 'Universidad Nacional Experimental De La Seguridad', 'UNES', 'Publica', 'Somos la institución académica especializada que se adscribe al paradigma científico, tecnológico-humanista, abierta a las necesidades locales, regionales, nacionales y latinoamericanas, cuya misión es formar para transformar garantizando el derecho a la ', 'Ser la institución de excelencia académica y marcado compromiso social, sustentada en los valores de confiabilidad, transparencia, eficacia y participación, orientados por su sentido ético hacia el respeto de los derechos humanos, libertades ciudadanas y ', 'descripcion', 'http://www.unes.edu.ve/', NULL, NULL, '', 10.4980849000, -66.7727496000, NULL, NULL, 14, 241, NULL, 0x2e2f696d672f554e45532d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f554e45532d6d61726361646f722e706e67, NULL, 0x2e2f696d672f554e45532d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(3, 'Universidad Venezolana de los Hidrocarburos', 'UVH-INTEVEP', 'Publica', 'La misión de la universidad se centra en la formación de profesionales altamente calificados en el sector de los hidrocarburos. Estos profesionales deben tener un enfoque integral y humanista, lo que significa que deben tener conocimientos técnicos, pero ', 'La visión de la universidad se centra en el logro de la excelencia académica, el compromiso social y la contribución al desarrollo del país. La excelencia académica se refiere a la calidad de la formación que ofrece la universidad. El compromiso social se', 'La UVH fue creada el 11 de agosto de 2009, mediante el decreto presidencial N° 6.063. Su creación fue impulsada por el gobierno venezolano, como parte de la Misión Alma Mater, con el objetivo de formar profesionales competentes en el sector de los hidr', '', NULL, NULL, '', 10.3643513409, -67.0397326970, NULL, NULL, 14, 232, NULL, 0x2e2f696d672f5556482d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f5556482d6d61726361646f722e706e67, NULL, 0x2e2f696d672f5556482d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(4, 'Universidad Politécnica Territorial del Estado Barinas José Félix Ribas', 'UPTBJFR', 'Publica', '', '', 'Antiguamente IUTEBA y Universidad Santa Inés es una universidad de carácter público que nace en el año 2001 (IUTEBA) y 2005 (Santa Inés) como universidad privada asociación civil Santa Inés con la oferta de 6 carreras para el área de pregrado a su', '', NULL, NULL, '', 8.6437814000, -70.2298896000, NULL, NULL, 5, 58, NULL, 0x2e2f696d672f6c6f676f732f555054424a46522d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f555054424a46522d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f555054424a46522d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(5, 'Universidad Politécnica Territorial Del Estado Aragua Federico Brito Figueroa', 'UPTAFBF', 'Publica', '', '', 'La UPTA fue creada el 16 de julio de 2010, mediante el decreto presidencial N° 6.063. Su antecedente inmediato fue el Instituto Universitario Experimental de la Victoria, fundado en 1976. La UPTA cuenta con cuatro sedes: La sede principal de la Victoria;', '', NULL, NULL, '', 10.2263668000, -67.3199338000, NULL, NULL, 4, 41, NULL, 0x2e2f696d672f555054412d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f555054412d6d61726361646f722e706e67, NULL, 0x2e2f696d672f555054412d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(6, 'Universidad Politécnica Territorial del Estado Lara Andrés Eloy Blanco', 'UPTAEB', 'Publica', '', '', 'La institución nació como Ciclo Básico Superior (CBS) en 1972, y fue la antesala de los estudiantes de educación superior que debían cursar dos semestres en esta casa de estudios antes ingresar a las universidades que, para la época funcionaban en B', 'https://www.uptaeb.edu.ve/', NULL, NULL, '', 10.0508748000, -69.3655801000, NULL, NULL, 12, 146, NULL, 0x2e2f696d672f6c6f676f732f5550544145422d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f5550544145422d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f5550544145422d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(7, 'Universidad Politécnica Territorial del Alto Apure Pedro Camejo', 'UPTALTAP', 'Publica', 'Ofrecer condiciones que permitan una formación integral de un Técnico Superior Universitario en correspondencia con los requerimientos socio- políticos, económicos, científicos y tecnológicos de la región y el país, a través de investigación (aplicada, in', 'Constituirse como institución de educación superior en Epicentro Tecnológico del Eje Apure – Orinoco, a través de la aplicación y construcción, de nuevas tecnologías y de servicios, orientada al desarrollo humano, la promoción social y equilibrio ecológic', 'La Universidad Politécnica Territorial del Alto Apure Pedro Camejo tiene como encargo social contribuir activamente al desarrollo endógeno integral y sustentable en su área de influencia territorial, con la participación activa y permanente del poder ', 'https://www.uptaltoapure.edu.ve/', NULL, NULL, '', 7.5848809000, -69.1110834000, NULL, NULL, 3, 31, NULL, 0x2e2f696d672f5550414c5441502d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f555054414150432d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f555054414150432d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(8, 'Universidad Politécnica Territorial de Barlovento Argelia Laya', 'UPTBAL', 'Publica', 'La Universidad Politécnica Territorial  de Barlovento Argelia Laya, debe promover a través de la generación y socialización del conocimiento, la innovación tecnológica, valores históricos y culturales, con pertinencia local, regional y nacional, garantiza', 'Ser modelo integral del Sistema Nacional de Educación Universitaria en el marco del modelo socialista, donde los procesos de formación creación y vinculación social, estén orientados al desarrollo integral  del potencial creativo, productivo e intelectual', 'En los años 70, se conformó un movimiento de Barloventeñas y Barloventeños que lucharon por la creación de un Instituto de Educación Universitaria para nuestra región de Barlovento. Entre ellos se encontraron el profesor Aristóbulo Istúriz, la pr', 'http://www.uptbal.edu.ve/', NULL, NULL, '', 10.4772480000, -66.1209886000, NULL, NULL, 14, 226, NULL, 0x2e2f696d672f55505442414c2d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f55505442414c2d6d61726361646f722e706e67, NULL, 0x2e2f696d672f55505442414c2d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(9, 'Universidad Nacional Experimental Francisco De Miranda', 'UNEFM', 'Publica', 'Corresponde a la Universidad Nacional Experimental Francisco de Miranda, como institución de educación superior de carácter experimental, generar conocimientos, formar integralmente ciudadanos conscientes, responsables y emprendedores, anticipar y aportar', 'Ser considerada la institución rectora de la Educación Superior en el Estado Falcón, integrada al Sistema Nacional de Educación y a redes académicas y de producción, comprometida y vinculada con la comunidad en el estudio y solución de sus problemas; reco', 'Es una institución pública venezolana de educación superior, con sede en el estado Falcón y fundada en julio de 1977. Hoy en día es una de las universidades más reconocidas y prestigiosas del país. Cuenta con un periódico, una emisora de radio (Un', 'http://unefm.edu.ve/', NULL, NULL, '', 11.4125012000, -69.6790279000, NULL, NULL, 10, 118, NULL, 0x2e2f696d672f6c6f676f732f554e45464d2d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f554e45464d2d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f554e45464d2d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(10, 'Universidad Centro Occidental Lisandro Alvarado', 'UCLA', 'Publica', 'Formar profesionales con competencias y afianzados principios humanos, como la ética, justicia, libertad y compromiso social,  difundir y generar  conocimientos, para contribuir con el desarrollo humanístico, científico y tecnológico de la nación.', 'Ser una institución con calidad académica y pertinencia social reconocida por su aporte al desarrollo regional y local, fundamentada en una cultura organizacional centrada en valores y en el desarrollo de competencias de su talento humano, orientada hacia', 'La Universidad Centroccidental Lisandro Alvarado fue creada el 22 de septiembre de 1962 por el Decreto Ejecutivo n.º 845,​ que dispuso el establecimiento del Centro Experimental de Estudios Superiores (CEDES) como núcleo y primera etapa de la UCLA, du', 'http://www.ucla.edu.ve/', NULL, NULL, '', 10.0679559537, -69.2998305798, NULL, NULL, 12, 146, NULL, 0x2e2f696d672f6c6f676f732f55434c412d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f55434c412d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f55434c412d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
