(49, 'Universidad Central de Venezuela', 'UCV', 'Publica', 'La Universidad Central de Venezuela tiene como misión crear, asimilar y difundir el saber mediante la investigación y la enseñanza; completar la formación integral iniciada en los ciclos educacionales anteriores; y formar los equipos profesionales y técni', 'Ser el centro de referencia nacional e internacional en la formación de talento humano necesario y en la generación, gestión y difusión del conocimiento.', 'La Universidad Central de Venezuela (UCV) es una universidad pública de Venezuela ubicada en la Urbanización Valle Abajo de la Parroquia San Pedro, al sur del centro geográfico de Caracas. Fundada en 1721 por el rey Felipe V, es la institución de educ', 'http://www.ucv.ve/', NULL, NULL, 'Urbanización Valle Abajo, Ciudad Universitaria de Caracas, Parroquia San Pedro, Municipio Libertador Caracas, Distrito Capital', 10.4909581071, -66.8916714999, NULL, NULL, 24, 462, NULL, 0x2e2f696d672f6c6f676f732f5543562d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f5543562d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f5543562d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05');
