(62, 'Universidad Nacional Experimental Politécnica de la Fuerza Armada Nacional', 'UNEFA', 'Publica', 'Formar a través de la docencia, la investigación y la extensión, ciudadanos y ciudadanas corresponsables de la seguridad y defensa integral de la nación, comprometidos con la REVOLUCIÓN BOLIVARIANA, con competencias emancipadoras y humanistas para sustent', 'Ser la primera universidad socialista, reconocida por su excelencia educativa a nivel nacional e internacional, líder en los saberes humanísticos, científicos, tecnológicos y militares inspirada en el ideario bolivariano.', 'Universidad ubicada en Caracas, la UNEFA ofrece 7 carreras de ingeniería, 7 licenciaturas y 6 carreras de Técnico Superior Universitario. Fue fundada en el año 1999.', 'http://www.unefa.edu.ve/portal/', NULL, NULL, 'Caracas, en la Avenida Fuerzas Armadas, Sector La Carlota.', 10.4842503552, -66.8530684444, NULL, NULL, 14, 225, NULL, 0x2e2f696d672f6c6f676f732f554e4546412d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f554e4546412d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f554e4546412d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(63, 'Universidad Politécnica Territorial del Zulia', 'UPTZ', 'Publica', 'Contribuir a la formación de un ser humano integral, centrado en principios y valores fundamentados en la ética socialista, comprometidos con el desarrollo endógeno sustentable, con sensibilidad ambiental, ecológica e identidad local, regional, nacional, ', 'Ser un referente nacional e internacional, en la formación de seres humanos integrales, promotora de pensamiento y conocimientos innovadores, comprometida con el desarrollo endógeno sustentable del país, fundamentada en valores y principios de la sociedad', 'La UPTZ ofrece una amplia gama de programas de formación técnica y profesional en las áreas de ingeniería, ciencias, administración, educación y humanidades. Sus programas se basan en el modelo de formación por proyectos, que enfatiza el desarrollo', 'https://uptzulia.edu.ve/', NULL, NULL, 'Urbanización el Amparo, 117 Calle La Estrella, Cabimas, Estado Zulia', 10.4223109187, -71.4646815994, NULL, NULL, 23, 443, NULL, 0x2e2f696d672f6c6f676f732f5550545a2d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f5550545a2d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f5550545a2d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(64, 'Universidad Simón Bolivar', 'USB', 'Publica', 'La misión de la Universidad Simón Bolívar es formar profesionales competentes, con un alto sentido de responsabilidad social, comprometidos con el desarrollo sustentable del país, en las áreas de Ciencias Sociales, Humanidades, Artes, Ciencias y Tecnologí', 'La USB se proyecta como una universidad de excelencia académica, que se destaque por su compromiso con la investigación, la innovación y la vinculación social. Una universidad que contribuya al desarrollo integral de sus estudiantes, al fortalecimiento de', 'Universidad ubicada en Sartenejas, Caracas, Miranda, la Universidad Simón Bolivar ofrece 19 carreras largas y 10 cortas. Fue fundada en el año 1967.', 'http://www.usb.ve/', NULL, NULL, 'Avenida Sur 5, Caracas 1080, Miranda, Caracas, Distrito Capital', 10.4104063588, -66.8759223274, NULL, NULL, 14, 225, NULL, 0x2e2f696d672f6c6f676f732f5553422d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f5553422d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f5553422d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05'),
(65, 'Universidad Nacional Experimental Marítima Del Caribe', 'UMC', 'Publica', 'Ofrecer soluciones eficientes y competitivas en la Gestión de Transporte Marítimo, Consultoría, Seguridad y Ambiente, Entrenamiento y Responsabilidad Social, con los más altos estándares de calidad y servicio, con el fin de apoyar el crecimiento y competi', 'Ser una compañía especializada a nivel internacional, en prestar servicios en la Gestión del Transporte Marítimo, Seguridad y Ambiente enfocada en las necesidades de nuestros clientes. La tecnología de avanzada y el desarrollo de nuestros recursos humanos', 'Universidad ubicada en Catia La Mar, La Guaira, la Universidad Marítima del Caribe es la única universidad de Venezuela en la que se forman ingenieros marítimos. También ofrece 5 carreras y fue fundada en el año 1811.', 'http://www.umc.edu.ve/', NULL, NULL, 'Av. Salvador Allende, Ciudad Universitaria, Naguanagua, Estado Carabobo', 10.6049069862, -67.0269984658, NULL, NULL, 21, 390, NULL, 0x2e2f696d672f6c6f676f732f554d432d6c6f676f2e706e67, 0x2e2f696d672f6d61726361646f7265732f554d432d6d61726361646f722e706e67, NULL, 0x2e2f696d672f706f7274616461732f554d432d7072696e636970616c2e706e67, '1', 'Definitiva', '1', NULL, NULL, '2024-02-06 15:07:05', NULL, '2024-02-06 15:07:05');
